script: |
  super -f text -I q10366.spq | sort > q10366.out

inputs:
  - name: q10366.spq
    data: |
      SELECT DISTINCT 10, col1 + - 90 + 17 + + - col2 * col0 * 30 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT NULL BETWEEN + col0 AND + col2;
  - name: tab0

outputs:
  - name: q10366.out
    data: |
